import React from 'react';
import logo from './logo.svg';
import Sidebar from "./Sidebar";
import Header from "./Header";
import './App.css';
const items = [
    { name: 'home', label: 'Home' },
    { name: 'n-and-ad', label: 'Notification & Advisory' },
    { name: 'trade-indicators', label: 'Trade Indicators' },
    { name: 'tariff-measures', label: 'Tariff Measures' },
    { name: 'non-tariff-measures', label: 'Non-Tariff Measures' },
    { name: 'commodity-wise-analysis', label: 'Commodity-wise Analysis' },
    { name: 'case studies', label: 'Case Studies' },]

function App() {
  return (
      <div>
        <Sidebar items={items}/>
        <div className="page">
          <Header/>
        </div>
      </div>
  );
}

export default App;
